	L.control.scale({ position: 'bottomleft', imperial: false }).addTo(map);

        attribution: 'Tiles &copy; Esri &mdash; Source: Esri, i-cubed, USDA, AEX, GeoEye, Getmapping, Aerogrid, IGN, IGP, UPR-EGP, and the GIS User Community'

		maxZoom: 17
	});

		subdomains: 'abcd',

	});
	
	const darkMatterLayer = L.tileLayer('https://{s}.basemaps.cartocdn.com/dark_all/{z}/{x}/{y}{r}.png', {
		attribution: '&copy; <a href="https://www.carto.com/">CARTO</a>',
		subdomains: 'abcd',
		maxZoom: 19
	});
	
	// Proměnná pro uložení markeru
    let currentMarker = null;

    // Přidání ovládacího prvku pro vyhledávání adres
    const geocoder = L.Control.geocoder({
        defaultMarkGeocode: false 
    }).addTo(map);
	
	const awesomeIcon2 = L.AwesomeMarkers.icon({
		icon: 'map-signs',        
		markerColor: 'green',  
		prefix: 'fa',         
		iconColor: 'white'    
	});

    // Akce při vyhledání adresy
    geocoder.on('markgeocode', function(e) {
        const latlng = e.geocode.center;

        // Pokud již existuje marker, odstraní se
        if (currentMarker) {
            map.removeLayer(currentMarker);
        }

        // Přidání nového markeru
        currentMarker = L.marker(latlng, { icon: awesomeIcon2 }).addTo(map)
			.bindPopup(`<strong>${e.geocode.name}</strong>`)
			.openPopup();

        // Přesunutí pohledu na nalezenou polohu
        map.setView(latlng, 14);

        // Zavření pop-up okna
        currentMarker.on('popupclose', () => {
            map.removeLayer(currentMarker); 
            currentMarker = null; 
        });
    });
		
	// Vytvoření popup obsahu s obrázkovou galerií a textem
	function createImageGalleryWithText(images, title, description) {
		
		// Uchování indexu aktuárlně zobrazeného obrázku
		let currentIndex = 0;																											
		
		// Prvek obsahující celou galerii
		const popupContent = document.createElement('div');																				
		popupContent.innerHTML = `
			<p style="font-weight: bold; text-align: center;">${title}</p>
			<div id="gallery-container" style="display: flex; align-items: center; justify-content: center;">
				<button id="prevBtn" style="font-size: 20px; background: none; border: none; cursor: pointer;">&#x25C0;</button>		 
				<img id="galleryImage" src="${images[currentIndex]}" style="max-width: 200px; max-height: 150px; margin: 0 10px;">		
				<button id="nextBtn" style="font-size: 20px; background: none; border: none; cursor: pointer;">&#x25B6;</button>
			</div>
			<p style="text-align: justify;">${description}</p>
		`;
		
		// Funkce pro aktualizaci obrázku
		function updateImage() {																										
			document.getElementById('galleryImage').src = images[currentIndex];
		}
		
		// Akce pro předchozí a následující tlačítko 
		popupContent.querySelector('#prevBtn').onclick = () => {
			currentIndex = (currentIndex - 1 + images.length) % images.length;
			updateImage();
		};

		popupContent.querySelector('#nextBtn').onclick = () => {
			currentIndex = (currentIndex + 1) % images.length;
			updateImage();
		};

		return popupContent;
	}

			}
			map.fitBounds(bounds);
			currentPolygon = L.polygon(bounds, { color: 'red' }).addTo(map);
		});
	}
